import React, { useEffect, useState } from 'react';
import { routes } from '../../App';
import background from "../../assets/trade-bg.jpg";
import { Link } from 'react-router-dom';
import './GoodsPage.scss'

const GoodsPage = () => {

    return (
        <div className='goods container' style={{ backgroundImage: `url(${background})` }}>
            <header className='goods__header'>
                <Link to={routes.menu}>
                    <img className='header__img' src="/images/arrow-left.svg"></img>
                </Link>

                <div className="header__order">
                    <div className="header__order-qty">
                        <p>
                            <span></span>&nbsp;товара
                        </p>
                        <p>
                            на сумму <span></span>&nbsp;&#8381;
                        </p>
                    </div>
                    <Link to={routes.cart}>
                        <img className='header__icon' src="/images/1.svg"></img>
                    </Link>
                    <button className='header__button' type="submit">Выйти</button>
                </div>
            </header>
<div className="goods__main"></div>
        </div>
    );
}

export default GoodsPage;
